import React from "react"

function About(){
return(
    <div id ="about" className="about">
    <div className="aboutLeft">
    <img className="manOnLaptop" alt = "" src={require("./manOnLAptop.png")} />
    <img className="quote" alt = "" src={require("./quote.png")}/>
    </div>
    <div className="aboutRight">
    <h1 color="white yellowText2">About me</h1>
    <p>I'm an undergraduate student focused on improving my technical skills and become a proficient full stack web developer</p>
    </div> 
    </div>
);
};

export default About;
